    justify-content: flex-start; 
    align-items: flex-start; 
    display: inline-flex
}
.version, .logout, .delete{
    color: #343A40;
    font-size: 16px;
    font-family: 'Pret-reg';
    font-weight: 400;
    line-height: 24px;
    word-wrap: break-word;
    padding-left: 16px;
    padding-top: 8px;
    padding-bottom: 8px;
    cursor: pointer;
}
  .hr {
    border-top: dashed 1px #dddddd;
  }
`
